window.bookSummaryJSON = "<p>In the deep black of space, there are no rules. Only pirates. And Rangers. </p> <p>A space opera boxed set in the deep black of space from number one best-selling author James David Victor.</p> <p>Captain Drummond Bayne is a Navy Ranger tasked with bringing order to the lawless reaches of space. When a simple mission turns deadly, they find themselves navigating space more dangerous than they can imagine. Can they save themselves and uncover a truth that could tear the galaxy apart? </p> <p><i>Captain Bayne Omnibus</i> contains the first three books in the exciting Deep Black space opera. If you like fast-paced space adventure, rogue pirates, and stories more complex than good vs. evil, you are going to love your visit to the Deep Black.</p>"; 
